import React from 'react'

const MyHeader = () => {
	return (
		<div className={'my-header'}>
			<div><h2>Contacts Book</h2></div>
			<div><a href="https://github.com/IrynaSolonenko">My GitHub account</a></div>

		</div>
	)
}

export default MyHeader
